import React from "react";
import { SocialIcon } from "react-social-icons";
import './HomePageSocialIconsStyle.css'

function HomePageSocialIcons() {
  return (
    <div className="social-icons-container">
      <SocialIcon url="https://twitter.com/oraldo_hysaj" />
      <SocialIcon url="https://www.instagram.com/oraldohysaj/" />
      <SocialIcon url="https://github.com/oraldo666" />
      <SocialIcon url="https://www.facebook.com/oraldo.hysaj/" />
      <SocialIcon url="https://www.linkedin.com/in/oraldo-hysaj-49210918a/" />


    </div>
  );
}

export default HomePageSocialIcons;
